import "./App.css";
import { Card } from "primereact/card";
import { Panel } from "primereact/panel";
//import { Splitter, SplitterPanel } from 'primereact/splitter';
import React, { useState, useLayoutEffect } from "react";
import { InputNumber } from "primereact/inputnumber";
import "primereact/resources/themes/lara-dark-purple/theme.css";

function App() {
  const [value1, setValue1] = useState(60);
  const [value2, setValue2] = useState(20);
  const [value3, setValue3] = useState(10);

  return (
    <div className="App">
      <header className="App-header">
        <Panel header="Macro Goals">
          <p className="m-0">
            Protein{" "}
            <InputNumber
              inputId="stacked-buttons"
              value={value1}
              onValueChange={(e) => setValue1(e.value)}
              inputClassName="quantity-input"
            />{" "}
            grams
          </p>
          <p className="m-0">
            Carbs{" "}
            <InputNumber
              inputId="stacked-buttons"
              value={value2}
              onValueChange={(e) => setValue1(e.value)}
              inputClassName="quantity-input"
            />{" "}
            grams
          </p>
          <p className="m-0">Fat 10g</p>
          <p className="m-0">Calories 1600kcals</p>
        </Panel>
        <Panel header="Dietary Restrictions">
          <p className="m-0">gluten free</p>
          <p className="m-0">dairy free</p>
          <p className="m-0">nut free</p>
        </Panel>
        <Panel header="Weight Goals">
          <p className="m-0">Current: 150lbs</p>
          <p className="m-0">Target: 180lbs</p>
        </Panel>
      </header>
    </div>
  );
}

export default App;
